// Assuming Pages.js is located in the same directory as App.js
import Pages from "./Pages"; // Adjust the path if necessary

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route element={<Pages />}>
            <Route path="login" element={<Login />} />
            <Route path="home" element={<Home />} />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
